import { Link } from "react-router-dom"
import NavBar from "./NavBar";

function Dashboard() {
  
  const myUser = localStorage.getItem("myUser");
    console.log(myUser);

    return (
        <div>
            {myUser !== null ?
                <div>
                    <h4>Welcome {JSON.parse(myUser).name}</h4>
                    <h2> DashBoard</h2>       


                </div>
                : <h2>Please Login</h2>
            }

        </div>
    )

}
export default Dashboard;
